import React from "react";
import CreateCategory from "../../../tasks/category/CreateCategory";
import UserLayout from "../../../../packages/userLayout/UserLayout";
import "./UserProfileStyle.css";
import OrangeButton from "../../../../packages/buttons/orangeButton/OrangeButton";

const UserProfile = ({ handleInput, logOut, handleSubmit, inputState }) => {
  return (
    <div className="page_wrapper">
      <UserLayout LogOut={logOut}>
        <h2 className="my_profile_title">Моят профил</h2>
        <div className="row">
          <div className="col-6">
            {" "}
            <label className={"user_profile_label"}>Потребителско име</label>
            <input
              type="text"
              name="username"
              onChange={handleInput}
              className={"user_profile_input"}
              value={inputState.username}
            />
          </div>
          <div className="col-6">
            <label className={"user_profile_label"}>Парола</label>
            <input
              type="text"
              name="password"
              className={"user_profile_input"}
              onChange={handleInput}
              value={inputState.password}
            />
          </div>
          <div className="col-6">
            <CreateCategory />
          </div>
        </div>

        <OrangeButton text={"Запази"} onClick={handleSubmit} />
      </UserLayout>
    </div>
  );
};

export default UserProfile;
